import React from "react";
import PropTypes from "prop-types";

function Result(props) {
  return (
    <div>
      You prefer <strong>{props.quizResult}</strong>!<p>compact</p> <br />
      <p>DSLR</p> <br />
      <p>consumerDSLR</p> <br />
      <p>mirrorless</p>
      <button onClick="myFunction()">DSLR</button>
      <div id="DSLR">dslr šous up</div>
      <button onClick="myFunction()">mirrorles</button>
      <div id="mirrorless">mirrorles šous up</div>
    </div>
  );
}

Result.propTypes = {
  quizResult: PropTypes.string.isRequired
};

export default Result;
